    true,nt"url": null,nt"notes": "The Not-in-Traffic Surveillance (NiTS) system
    is a virtual data collection system designed to provide counts and details regarding
    fatalities and injuries that occur in non-traffic crashes and in non-crash incidents.
    NiTS non-traffic crash data is obtained through NHTSA's National Automotive Sampling
    System, General Estimates System (NASS GES) and the Fatality Analysis Reporting
    System (FARS). NiTS non-crash injury data is based upon emergency department records
    from a special study conducted by the Consumer Product Safety Commission's National
    Electronic Injury Surveillance System (NEISS) All Injury Program. NiTS non-crash
    fatality data is derived from death certificate information from the Centers for
    Disease Control's National Vital Statistics System.",nt"license_title": "U.S.
